import React, { Component } from "react"

export default class Dog extends Component {

    displayPupNames = () => {
        fetch("http://localhost:3000/pups")
            .then(resp => resp.json())
            .then(pups => {
                console.log(pups)
            })
    }


    render() {
        return

    }
}
